import React from "react";


class Item extends React.Component{

    //constructor
    constructor(props){
        super(props)
    }



    clickMe(){
        console.log(`I have clicked on ${this.props.name}`)
    }


    render(){
        return (
            <h1 onClick={()=> this.clickMe()}>Hello {this.props.name}</h1>
        )
    }
}



export  default Item;
